-- Initialisiert das Level
function setlevel()
  isclicked = false
  for i= 0, levels[level].kugel_a-1 do 
    baelle[i] = {
    r = levels[level].kugel_d,
    alive = true,
    x= math.random(platform.window:width()-levels[level].kugel_d)-1,
    y= math.random(platform.window:height()-levels[level].kugel_d)-1,
    vx= 0,
    vy= 0,
    color= math.random(#farben),
    livetime= -1,
    }
    baelle[levels[level].kugel_a]={
    	x = 0,
    	y = 0,
    	vx = 0,
    	vy = 0,
    	color = -1,
    	r = 0,
    	livetime = -1,
    	alive = false,
    }
    local r = math.random(1,2)
    baelle[i].vx = math.random(1,3)
    if r == 2 then
      baelle[i].vx = -baelle[i].vx 
    end
    local r = math.random(1,2)
    baelle[i].vy = math.random(1,3)
    if r == 2 then
      baelle[i].vy = -baelle[i].vy 
    end
  end
  if not(level == 1) then
  	cursor.set("crosshair")
    cursor.show()
  end
  geschafft = true
  gefangen = 0
  timer.start(timeint)
end
