-- Timer 
function on.timer()
  if screen == 0 then
    for i= 0, levels[level].kugel_a do  
      bewege_baelle(i)
      kollision(i)
    end
  end
  if screen == 1 then
    running = false
    for i= 0, levels[level].kugel_a  do
      if baelle[i].r > 0 then
        kollision(i)
        bewege_baelle(i)
        if (baelle[i].alive == false) then
        	infect(i)
        	if not(baelle[i].livetime == 0) then
      	    make_big(i)
        	end
      	  make_small(i)
        end
        check_running(i)  
      end
    end
    if (running == false) and (baelle[levels[level].kugel_a].color == 0) then 
    	timer.stop()
    	check_success()
    end
  end
  platform.window:invalidate()
end

function paint_back(gc)
  gc:setColorRGB(0,0,0)
  gc:fillRect(0,0,platform.window:width(),platform.window:height())
end

function check_running(i)
  if (baelle[i].alive == false) then
      running = true
  end 
end

function check_success()
  t= -1
  for i=0, levels[level].kugel_a do
    if baelle[i].alive == false then
      t= t +1
    end  
  end
  if t>= levels[level].kugel_min then
    if level == 0 then
      screen = 2
    else
      level = level + 1
      screen = 2
    end
    platform.window:invalidate()
  else
  	screen = 2 
  	geschafft = false
  	platform.window:invalidate()
  end
end

function paint_ball(gc)
  for i= 0, levels[level].kugel_a do
    if baelle[i].r > 0 then
     gc:setColorRGB(farben[baelle[i].color].r,farben[baelle[i].color].g,farben[baelle[i].color].b)
     gc:fillArc(baelle[i].x,baelle[i].y,baelle[i].r,baelle[i].r,0,360)    	  
    end
  end
end

function infect(i)
  for j= 0, levels[level].kugel_a do
    if (not(j==n)) and (baelle[j].alive == true) then
      if baelle[i].r / 2 + baelle[j].r / 2 >= 
      	math.sqrt(math.pow(math.abs((baelle[i].x + baelle[i].r / 2)- (baelle[j].x+ baelle[j].r / 2)),2) 
        + math.pow(math.abs((baelle[i].y + baelle[i].r / 2)- (baelle[j].y+ baelle[j].r / 2)),2)) then
        baelle[j].alive = false
        baelle[j].vx = 0
        baelle[j].vy = 0
        baelle[j].color = 0
        baelle[j].livetime = -1
        gefangen = gefangen + 1
      end
    end	
  end
end

function make_small(i)
  if baelle[i].livetime == 0 then
    if baelle[i].r > 0 then
      baelle[i].r = baelle[i].r - fade_time
      baelle[i].x = baelle[i].x + fade_time / 2
      baelle[i].y = baelle[i].y + fade_time / 2
    end 
  else
  	baelle[i].livetime = baelle[i].livetime -1 
  end
end

function make_big(i)
  if baelle[i].r < levels[level].erreger_d then
    baelle[i].r = baelle[i].r + fade_time
    baelle[i].x = baelle[i].x - fade_time / 2
    baelle[i].y = baelle[i].y - fade_time / 2 
  elseif (baelle[i].r >= levels[level].erreger_d) and (baelle[i].livetime <= -1) then
    --baelle[i].r = levels[level].erreger_d
    if level == 0 then
      baelle[i].livetime = 1/ timeint * clivetime
    else
    	baelle[i].livetime = 1/ timeint * livetime
    end
  end
end

function bewege_baelle(i)
    baelle[i].x = baelle[i].x + baelle[i].vx
    baelle[i].y = baelle[i].y + baelle[i].vy
end

function kollision(i)
  if (baelle[i].x+ baelle[i].r > platform.window:width()) or (baelle[i].x < 0) then
    baelle[i].vx = -baelle[i].vx
  end
  if (baelle[i].y+ baelle[i].r> platform.window:height()) or (baelle[i].y < 0) then
  	baelle[i].vy = -baelle[i].vy
  end
end

function deletelastchar(s)
  news = ""
  for i= 1, string.len(s)-1 do
  	news = news .. string.char(string.byte(s,i))
  end
  return news
end

function on.charIn(char)
  if (char == ".") and (menu == 4) and (screen == 4) then
    clivetime = clivetime ..char
  end 
  if (screen == 4) and ((char=="1")or(char=="2")or(char=="3")or(char=="4")or(char=="5")or(char=="6")or(char=="7")or(char=="8")or(char=="9")or (char=="0")) then
    if (menu == 0) and (string.len(levels[level].kugel_a)<= 2) then
    	levels[level].kugel_a = levels[level].kugel_a .. char 
    elseif (menu == 1)  and (string.len(levels[level].kugel_d)<= 2) then
      levels[level].kugel_d = levels[level].kugel_d .. char
    elseif (menu == 2) and (string.len(levels[level].kugel_min)<= 2) then
      levels[level].kugel_min = levels[level].kugel_min .. char
    elseif (menu == 3) and (string.len(levels[level].erreger_d)<= 2) then
    	levels[level].erreger_d = levels[level].erreger_d .. char
    elseif (menu == 4) and (string.len(clivetime)<= 2) then 
    	clivetime = clivetime ..char
    end
  end
  if screen == 0 then
  	if char == "1" then
      screen = 2
      level = 2
    end
    if char == "2" then
    	screen = 3
    end
    if char == "3" then
      level = 0
      menu = 0
      screen = 4
    end
  end
  platform.window:invalidate()
end

function on.enterKey()
  if screen == 2 then
    if level == 0 then
    	setlevel()
    elseif level > #levels then
      level = 2
      setlevel()
    end
    screen = 1
    setlevel()
  end
  if screen == 3 then
    screen = 2
    level = 2
    platform.window:invalidate()
  end
  if screen == 4 then
    levels[level].kugel_a = tonumber(levels[level].kugel_a)
    if tonumber(levels[level].kugel_min) > levels[level].kugel_a then
      levels[level].kugel_min = levels[level].kugel_a
    else
      levels[level].kugel_min = tonumber(levels[level].kugel_min)
    end
    levels[level].kugel_d = tonumber(levels[level].kugel_d)
    levels[level].erreger_d = tonumber(levels[level].erreger_d)
    clivetime = tonumber(clivetime)
    screen = 1
    setlevel()
    platform.window:invalidate()
  end 
end

function on.mouseDown(x,y)
  if (screen == 1) and (isclicked == false)  then
    baelle[levels[level].kugel_a]={
    	x = x,
    	y = y,
    	vx = 0,
    	vy = 0,
    	color = 0,
    	r = levels[level].kugel_d,
    	livetime = -1,
    	alive = false,
    }
    isclicked = true
  end
end

function on.backspaceKey()
  if screen == 4 then
    if menu == 0 then
    	if string.len(levels[level].kugel_a) > 0 then
    		levels[level].kugel_a = deletelastchar(levels[level].kugel_a) 
    	end
    elseif menu == 2 then
      if string.len(levels[level].kugel_min) > 0 then
        levels[level].kugel_min = deletelastchar(levels[level].kugel_min)
      end
    elseif menu == 1 then
      if string.len(levels[level].kugel_d) > 0 then
        levels[level].kugel_d = deletelastchar(levels[level].kugel_d)
      end
    elseif menu == 3 then
    	if string.len(levels[level].erreger_d) > 0 then
    	  levels[level].erreger_d = deletelastchar(levels[level].erreger_d)
    	end  
    else 
    	if string.len(clivetime) > 0 then
    	  clivetime = deletelastchar(clivetime)
    	end
    end
  end
end 

function on.arrowDown()
  if screen == 4 then
    if menu == 4 then 
      menu = 0
    else 
    	menu = menu +1
    end
  end
end

function on.arrowUp()
  if screen == 4 then
  	if menu == 0 then
  		menu = 4
  	else
  		menu = menu -1
  	end
  end 
end
function on.tabKey()
  timer.stop()
  screen = 0
  level = 1
  setlevel()
end

